import React, { useState, useEffect } from "react";
import "./App.css";
import BirthdayForm from "./BirthdayForm";
import BirthdayList from "./BirthdayList";

function App() {
  const [birthdays, setBirthdays] = useState([
    {
      name: "Abhishek Choudhary",
      date: "2004-01-28",
      image:
        "https://pps.whatsapp.net/v/t61.24694-24/364525122_870467214502986_6484205720159841995_n.jpg?ccb=11-4&oh=01_AdR3ClNL7m3gWR9WvylxvRZYrZLbMDPWz95Oqqd9eh-wtw&oe=64FD42AE&_nc_cat=100",
    },
    {
      name: "Narendra Modi",
      date: "1950-9-17",
      image:
        "data:image/jpeg;base64,",
    },
    {
      name: "Amit shah",
      date: "1964-10-22",
      image:
        "data:image/jpeg;base64,",
    },
  ]);

  const addBirthday = (newBirthday) => {
    setBirthdays([...birthdays, newBirthday]);
  };

  const removeBirthday = (name) => {
    const updatedBirthdays = birthdays.filter(
      (birthday) => birthday.name !== name
    );
    setBirthdays(updatedBirthdays);
  };

  useEffect(() => {
    const storedBirthdays = JSON.parse(localStorage.getItem("birthdays"));
    if (storedBirthdays) {
      setBirthdays(storedBirthdays);
    }
  }, []);

  useEffect(() => {
    localStorage.setItem("birthdays", JSON.stringify(birthdays));
  }, [birthdays]);

  return (
    <div className="App">
      <h1>Birthday Reminder</h1>
      <BirthdayForm addBirthday={addBirthday} />
      <BirthdayList birthdays={birthdays} removeBirthday={removeBirthday} />
    </div>
  );
}

export default App;
